import React from 'react';
import Button from './Button';

const ModalContent = ({ title, items = []}) => {

    const onButtonClick = (event) => {
        console.log("Clicked");
    }

    return (
        <div>
            <h3>{title}</h3>
            <div>
                {items.length !== 0  &&
                items.map((item, id) => {
                        return(
                        <div key={id}>
                            <div>
                            <h5>{item.name}</h5>
                            <h6>
                                <a href={item.html_url}>{item.html_url}</a>
                            </h6>
                            </div> 
                        </div>
                        )
                    }
                )
            }

            {items.length !== 0 && (
                <Button onClick={this.onButtonClick} />
            )
            }
            </div>
        </div>
    );
}

export default ModalContent;
